import React, {Component} from 'react';
import './App.css';

class Header extends Component {
  render(){
    return(
      <header>
        <div>this is the header</div>
      </header>
    )
  }
}

class Nav extends Component {
  render(){
    return(
      <nav>
        <ul>
          <li href="html.html">HTML</li>
          <li href="css.html">CSS</li>
          <li href="js.html">Javascript</li>
        </ul>
      </nav>
    )
  }
}

class Content extends Component {
  render(){
    return(
      <article>
        <h1>HTML</h1>
        HTML is HyperText Markup Language.
      </article>
    )
  }
}

class App extends Component {
  render(){
    return (
      <div className="App">
        <Hearder></Hearder>
        <Nav></Nav>
        <Content></Content>
      </div>
    );
  }
}

export default App;
